import VideoModal from "../styled/modalStyled/VideoModal";

const Post = () => {
  return (
    <PostStyled>
      <VideoModal />
      <VideoWrapper />
      <UserBlock />
      #Tag1 #Tag2 #Tag3
    </PostStyled>
  );
};

export default Post;
